import React from "react";
import "./chart.css";
import { Line, LineChart, ResponsiveContainer, XAxis } from "recharts";

export default function Chart() {
  const data = [
    {
      name: "Jan",
      ActiveUser: 4000,
    },
    {
      name: "Feb",
      ActiveUser: 3200,
    },
    {
      name: "Mar",
      ActiveUser: 4500,
    },
    {
      name: "Apr",
      ActiveUser: 3900,
    },
    {
      name: "May",
      ActiveUser: 3600,
    },
    {
      name: "Jun",
      ActiveUser: 3300,
    },
    {
      name: "Jul",
      ActiveUser: 3600,
    },
    {
      name: "Aug",
      ActiveUser: 3400,
    },
    {
      name: "Sep",
      ActiveUser: 3500,
    },
    {
      name: "Oct",
      ActiveUser: 2200,
    },
    {
      name: "Nov",
      ActiveUser: 3600,
    },
    {
      name: "Dec",
      ActiveUser: 3300,
    },
  ];
  return (
    <div className="Chart">
      <h3 className="chartTitle">sales Analytics</h3>
      {/* aspect mean 4 unit for width 1 unit for height (if width 400 height 100) */}
      <ResponsiveContainer width="100%" aspect={4 / 1}>
        <LineChart data={data}>
          <XAxis dataKey="name" stroke="2076e6"></XAxis>
          <Line type="monotone" dataKey="ActiveUser" stroke="black"></Line>
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}
